// src/components/FirmFacts/FirmFacts.tsx
import React from 'react';
import './FirmFacts.scss';
import FirmFactCard from '../FirmFactCard/FirmFactCard';

const FirmFacts: React.FC = () => {
  // Card content data
  const cardContent = [
    { text: "This is a two line button that terminates with ...", variant: "default" },
    { text: "This is a two line button that terminates with ...", variant: "border" },
    { text: "This is a two line button that terminates with ...", variant: "default" },
    { text: "This is a two line button that terminates with ...", variant: "border" },
    { text: "This is a two line button that terminates with ...", variant: "default" },
    { text: "This is a two line button that terminates with ...", variant: "border" },
    { text: "This is a one line button", variant: "border" },
  ];

  return (
    <div className="firmFacts-wrapper">
      <button className="close-button">X</button>
      <div className="firmFacts-title">Firm Facts</div>
      <div className="firmFacts-line"></div>
      <div className="firmFacts">
        {cardContent.map((card, index) => (
          <FirmFactCard 
            key={index} 
            variant={card.variant} 
            buttonText={card.text} 
          />
        ))}
      </div>
    </div>
  );
};

export default FirmFacts;
